def process(data_table_elements, main_df, file_counter):
    for row in data_table_elements:
        op = {}
        op["title"] = row.xpath("./td[1]/text()")
        op["upload_date"] = row.xpath("./td[2]/text()")[0]
        datetime_op = datetime.datetime.strptime(op["upload_date"], "%B-%Y")
        link_js = row.xpath("./td[3]/a/@href")
        js = re.search(r"javascript:__doPostBack\('(.*?)'", link_js[0]).group(1)
        logger.info(js)
        file_data = {
            "__EVENTTARGET": "_ctl0$BodyContentPlaceHolder$listBonds$_ctl2$btnDownload",
            "__EVENTARGUMENT": "",
            "__VIEWSTATE": "",
            "__EVENTVALIDATION": "",
        }
        file_data["__EVENTTARGET"] = js
        if True:
            file_response = session.post(
                "https://www.fimmda.org/modules/bonds/corporate-bonds.aspx?m=ccb",
                headers=headers,
                data=file_data,
                verify=False,
            )
            if file_response.status_code == 200:
                with io.BytesIO(file_response.content) as fh:
                    file_type_str = file_response.headers["Content-Disposition"]
                    if ".xlsx" in file_type_str:
                        df_list = pd.read_excel(fh, sheet_name=None, engine="openpyxl")
                    else:
                        df_list = pd.read_excel(fh, sheet_name=None, engine="xlrd")
                    for sheet_name, df in df_list.items():
                        if "excluding" in sheet_name.lower():
                            if (
                                "Excluding_Revised" in df_list.keys()
                                and sheet_name == "Excluding_Revised"
                            ):
                                df.columns = df.iloc[0]
                                if df.iloc[-2].isna().all():
                                    df = df.iloc[1:-2].reset_index(drop=True)
                                else:
                                    df = df.iloc[1:].reset_index(drop=True)
                                if main_df.columns.to_list() != df.columns.to_list():
                                    if len(main_df):
                                        main_df.to_excel(
                                            f"/Users/surya.s/Documents/fimmda/fimmda_consolidated_files_{file_counter}.xlsx",
                                            index=False,
                                        )
                                        file_counter += 1
                                    main_df = pd.DataFrame(columns=df.columns.to_list())
                                main_df = pd.concat([main_df, df])
                                logger.info(df.head())
                                logger.info(f"Processed sheet - {sheet_name}")
                            elif "Excluding_Revised" not in df_list.keys():
                                df.columns = df.iloc[0]
                                if df.iloc[-2].isna().all():
                                    df = df.iloc[1:-2].reset_index(drop=True)
                                else:
                                    df = df.iloc[1:].reset_index(drop=True)
                                if main_df.columns.to_list() != df.columns.to_list():
                                    if len(main_df):
                                        main_df.to_excel(
                                            f"/Users/surya.s/Documents/fimmda/fimmda_consolidated_files_{file_counter}.xlsx",
                                            index=False,
                                        )
                                        file_counter += 1
                                    main_df = pd.DataFrame(columns=df.columns.to_list())
                                main_df = pd.concat([main_df, df])
                                logger.info(df.head())
                                logger.info(main_df.head())
                                logger.info(f"Processed sheet - {sheet_name}")

                        else:
                            logger.info(f"********{sheet_name}***********")
    return main_df, file_counter


